    function formatNumber(value) {
        let numericValue = parseFloat(value);
        if (!isNaN(numericValue)) {
            return numericValue.toLocaleString('pt-BR', { style: 'currency', currency: 'BRL' }).replace('R$', '').trim();
        } else {
            return '';
        }
    }



