                    const containerRedes = document.querySelector(".container_redes");
                    const containerZoomPdf = document.querySelector(".container_zoom_pdf");
                    const listarPlanos = document.querySelector(".listar_planos");
                    const listarPlanosContainer = document.querySelector(".listar_planos_container");

                    if (containerObservacoes && containerObservacoes.style.display !== 'none') {
                        containerObservacoes.classList.add('hidden');
                    }

                    if (containerCoparticipacao && containerCoparticipacao.style.display !== 'none') {
                        containerCoparticipacao.classList.add('hidden');
                    }

                    if (containerPdfAll && containerPdfAll.style.display !== 'none') {
                        containerPdfAll.classList.add('hidden');
                    }

                    if (containerLogo && containerLogo.style.display !== 'none') {
                        containerLogo.classList.add('hidden');
                    }

