                                            document.querySelector(".copartipacao_valor_05_resultado").textContent = res.coparticipacao_valor_05;

                                            document.querySelector("#coparticipacao_titulo_01").value = res.coparticipacao_titulo_01;
                                            document.querySelector("#coparticipacao_titulo_02").value = res.coparticipacao_titulo_02;
                                            document.querySelector("#coparticipacao_titulo_03").value = res.coparticipacao_titulo_03;
                                            document.querySelector("#coparticipacao_titulo_04").value = res.coparticipacao_titulo_04;
                                            document.querySelector("#coparticipacao_titulo_05").value = res.coparticipacao_titulo_05;
                                            document.querySelector("#coparticipacao_valor_01").value = formatNumber(res.coparticipacao_valor_01);
                                            document.querySelector("#coparticipacao_valor_02").value = formatNumber(res.coparticipacao_valor_02);
                                            document.querySelector("#coparticipacao_valor_03").value = formatNumber(res.coparticipacao_valor_03);
                                            document.querySelector("#coparticipacao_valor_04").value = formatNumber(res.coparticipacao_valor_04);
                                            document.querySelector("#coparticipacao_valor_05").value = formatNumber(res.coparticipacao_valor_05);
                                        } else {
                                            document.querySelector(".container_pdf_all").classList.add("hidden");
                                            document.querySelector(".container_logo").classList.add("hidden");
                                            document.querySelector(".container_redes").classList.add("hidden");
                                            document.querySelector(".container_zoom_pdf").classList.add("hidden");

                                            document.querySelector("#linha01").value = '';
                                            document.querySelector("#linha02").value = '';
                                            document.querySelector("#linha03").value = '';

                                            document.querySelector("#linha_01_observacoes").textContent = 'Linha 01';
                                            document.querySelector("#linha_02_observacoes").textContent = 'Linha 02';
                                            document.querySelector("#linha_03_observacoes").textContent = 'Linha 03';

