                                            document.querySelector(".copartipacao_valor_02_resultado").textContent = '-';
                                            document.querySelector(".copartipacao_valor_03_resultado").textContent = '-';
                                            document.querySelector(".copartipacao_valor_04_resultado").textContent = '-';
                                            document.querySelector(".copartipacao_valor_05_resultado").textContent = '-';

                                            document.querySelector("#coparticipacao_titulo_01").value = '';
                                            document.querySelector("#coparticipacao_titulo_02").value = '';
                                            document.querySelector("#coparticipacao_titulo_03").value = '';
                                            document.querySelector("#coparticipacao_titulo_04").value = '';
                                            document.querySelector("#coparticipacao_titulo_05").value = '';
                                            document.querySelector("#coparticipacao_valor_01").value = '';
                                            document.querySelector("#coparticipacao_valor_02").value = '';
                                            document.querySelector("#coparticipacao_valor_03").value = '';
                                            document.querySelector("#coparticipacao_valor_04").value = '';
                                            document.querySelector("#coparticipacao_valor_05").value = '';
                                        }
                                    })
                                    .catch(error => {
                                        console.error('Error:', error);
                                    });
                            });
                        });
                        // Forçar trigger change no primeiro input radio
                        const firstRadio = listarPlanosContainer.querySelector("input[name='planos']");
                        if (firstRadio) {
                            firstRadio.checked = true;
                            const event = new Event('change', { bubbles: true });
                            firstRadio.dispatchEvent(event);
                        }
                    } else {
                        listarPlanos.classList.add('hidden');
                        listarPlanosContainer.innerHTML = '';
                    }
                })
                .catch(error => {

                });
        }

        //mudarOperadora(operadoraSelecionadaId);
    }

